`]}),`
`,$.jsxs(t.p,{children:["The Fellowship will decide, via an on-chain voting mechanism including members III-Dan or above, when to approve and merge RFCs. It does so by issuing an on-chain remark with the body ",$.jsx(t.code,{children:"RFC_APPROVE(xxxx, h)"})," from the ",$.jsx(t.code,{children:"Fellows"})," origin on the Polkadot Collectives blockchain, where xxxx is the number of the RFC and h is the blake2-256 hash of the raw proposal text. Once this remark has been made, the PR can be merged. This on-chain process is designed to be resilient to where the RFCs are hosted and in what format, so it can be migrated away from GitHub in the future. The fellowship should not approve more than one RFC with the same number."]}),`
`,$.jsxs(t.p,{children:["The Fellowship may also decide to reject an RFC by issuing a remark with the text ",$.jsx(t.code,{children:"RFC_REJECT(xxxx, h)"}),". This is a formality to provide clarity on when PRs (or their analogue on non-GitHub platforms) may be closed. PRs may be closed by their author, as well. PRs may be closed when sufficiently stale, as well - after a period of 1 year without acceptance."]}),`
